VKIcons.findKey = function(key) {
    let retValue
    Object.values(VKIcons).forEach(values => {
        for (const [k,v] of Object.entries(values)) {
            if (v.link == key) {
                retValue = v
                return
            }
        }
    })
    return retValue
}

String.prototype.inject = function (text) {
    let svg = this.indexOf("<svg")
    let index = 5 + svg
    return this.substring(0,index) + text + " " + this.substring(index)
}

String.prototype.as_data = function() {
    return `data:image/svg+xml;utf8,${this}`
}

VKReact.VKIcons = VKIcons